"use strict";(self.webpackChunkmy_vuepress_site=self.webpackChunkmy_vuepress_site||[]).push([[53],{80:(e,a,r)=>{r.r(a),r.d(a,{comp:()=>t,data:()=>i});var p=r(641);const n={},t=(0,r(262).A)(n,[["render",function(e,a){return(0,p.uX)(),(0,p.CE)("div",null,a[0]||(a[0]=[(0,p.Fv)('<h1 id="客户端" tabindex="-1"><a class="header-anchor" href="#客户端"><span>客户端</span></a></h1><p>客户端是本地借助豆包来生成图片。</p><p><img src="/images/client0.png" alt=""></p><h2 id="登录豆包" tabindex="-1"><a class="header-anchor" href="#登录豆包"><span>登录豆包</span></a></h2><p>首先你需要先在浏览器上登录豆包。这里必须用 chrome 浏览器。<a href="https://www.google.com/chrome/" target="_blank" rel="noopener noreferrer">chrome</a></p><p>序号 2 中，端口和文件夹解释如下。</p><p>因为，一个单一账号的豆包一天生成的图片并不是无限的，如果你一天生成的图片过多，就生成不了了。</p><p>chrome 浏览器可以多个浏览器用户共同登录。</p><p>你点击浏览，可以将该浏览器用户的数据放在某一个文件夹中，便于后续管理。</p><p>端口使用 9445 - 10000 之间的数字，任何一个都行「不需要固定」。</p><p>但是，同一时间，客户端最好只运行一个。</p><p>你可以通过浏览增加多个用户，并且在网页上登录豆包账号。当一个账号一天使用达到上限后，就换一个用户登录。</p><p>需要注意的是，豆包的登录并不是永久的，所以，有可能要隔一段时间就要登录一次。</p><p>将端口和浏览器的文件夹选中后，就点击「打开chrome浏览器」就行。</p><p>在新打开的浏览器中，访问 <a href="https://www.doubao.com/" target="_blank" rel="noopener noreferrer">豆包</a></p><p>在上面网页中登录自己的账号。</p><h2 id="生成" tabindex="-1"><a class="header-anchor" href="#生成"><span>生成</span></a></h2><p>输入我给你的 url 到 1 ，然后，点击运行就好了。</p>',18)]))}]]),i=JSON.parse('{"path":"/md/client/client.html","title":"客户端","lang":"zh-CN","frontmatter":{},"headers":[{"level":2,"title":"登录豆包","slug":"登录豆包","link":"#登录豆包","children":[]},{"level":2,"title":"生成","slug":"生成","link":"#生成","children":[]}],"git":{"updatedTime":1746881225000,"contributors":[{"name":"xiniu2023","username":"","email":"licong1309401095@gmail.com","commits":1}],"changelog":[{"hash":"9e434d85db28c69422bb5f5f7271a78054a18f32","time":1746881225000,"email":"licong1309401095@gmail.com","author":"xiniu2023","message":"init"}]},"filePathRelative":"md/client/client.md"}')}}]);